drop table if exists archival_xray;
CREATE TABLE archival_xray (
    id INTEGER PRIMARY KEY AUTO_INCREMENT,  -- unique ID for each row
    ero_name VARCHAR(255) NOT NULL,
    arch_flag DOUBLE,
    arch_date VARCHAR(255),
    arch_flux DOUBLE,
    arch_flux_err DOUBLE,
    arch_instrument VARCHAR(255),
    FOREIGN KEY (ero_name) REFERENCES eroextra_master_erosita(ero_name)
);
